import React, { useState } from 'react';
import { map } from 'lodash';
import { useAnimeState } from '../ducks/anime/selectors';

const Detail = (props): JSX.Element => {
	const [details, setDetail] = useState(props);

	return (
		<>
			<div>
				{details.map((detail) => (
					<p>{detail}</p>
				))}{' '}
			</div>
		</>
	);
};

export default Detail;
